module.exports = "<section style=\"margin-bottom: 30px; margin-top: 30px;\">\r\n    <form #frmLogin=\"ngForm\" name=register id=\"login-form\" action=\"#\" method=\"post\" [formGroup]=\"formGroup\"\r\n        fxLayout=\"column\" fxLayoutAlign=\"center center\" fxLayoutGap=\"50px\" fxLayout.lt-lg=\"column\"\r\n        fxLayoutAlign.lt-lg=\"center center\">\r\n        <div class=\"mat-elevation-z8\" fxLayout=\"column\" fxLayoutAlign=\"center center\" fxLayoutGap=\"50px\"\r\n            style=\"width: 580px;\">\r\n            <div style=\"margin-top: 30px;\">\r\n                <div class=\"panel-heading\" style=\"margin-top: 30px;\">\r\n                    <h3>Registrarse en el Sitio</h3>\r\n                </div>\r\n                <br>\r\n                <mat-form-field hideRequiredMarker ngClass.lt-lg=\"input-sm\">\r\n                    <input type=\"email\" matInput placeholder=\"Nombre de usuario\" [(ngModel)]=\"registerUserData.name\"\r\n                        name=\"name\" class=\"input-login\" style=\"color: black !important\" id=\"Nombre\" tabindex=\"1\"\r\n                        formControlName=\"name\" ngModel required (input)=\"habilitarRegistrar()\">\r\n                    <button mat-button matSuffix mat-icon-button aria-label=\"Clear\" (click)=\"registerUserData.name=''\">\r\n                        <mat-icon>close</mat-icon>\r\n                    </button>\r\n                    <mat-error *ngIf=\"name.hasError('required')\">Usuario requerido</mat-error>\r\n                </mat-form-field>\r\n\r\n                <mat-form-field hideRequiredMarker ngClass.lt-lg=\"input-sm\">\r\n                    <input #email_usuario type=\"email\" matInput placeholder=\"E-mail\"\r\n                        [(ngModel)]=\"registerUserData.email\" [pattern]=\"emailPattern\" name=\"email\" class=\"input-login\"\r\n                        style=\"color: black !important\" name=\"email\" id=\"username1\" tabindex=\"1\" formControlName=\"email\"\r\n                        ngModel required (input)=\"habilitarRegistrar()\">\r\n                    <button mat-button matSuffix mat-icon-button aria-label=\"Clear\" (click)=\"registerUserData.email=''\">\r\n                        <mat-icon>close</mat-icon>\r\n                    </button>\r\n                    <mat-error *ngIf=\"email.hasError('pattern')\">Email no válido</mat-error>\r\n                    <mat-error *ngIf=\"email.hasError('required')\">Email no válido</mat-error>\r\n                </mat-form-field>\r\n\r\n                <mat-form-field hideRequiredMarker ngClass.lt-lg=\"input-sm\">\r\n                    <input type=\"password\" matInput placeholder=\"Contraseña\" [(ngModel)]=\"registerUserData.password\"\r\n                        pattern=\"^(?=.*[a-z])(?=.*[A-Z])(?=.*\\d)[A-Za-z\\d$@$!%*?&]{8,15}$\" name=\"password\"\r\n                        [type]=\"hide ? 'password' : 'text'\" class=\"input-login\" style=\"color: black !important\"\r\n                        name=\"password\" id=\"password\" tabindex=\"2\" formControlName=\"password\" ngModel required\r\n                        (input)=\"habilitarRegistrar()\">\r\n                    <button mat-icon-button matSuffix (click)=\"hide = !hide\" [attr.aria-label]=\"'Hide password'\"\r\n                        [attr.aria-pressed]=\"hide\">\r\n                        <mat-icon>{{hide ? 'visibility_off' : 'visibility'}}</mat-icon>\r\n                    </button>\r\n\r\n                    <mat-error *ngIf=\"password.hasError('pattern')\">La contraseña debe tener al menos 8(ocho) caracteres\r\n                        y\r\n                        contener al menos una mayúscula y un dígito.</mat-error>\r\n                    <mat-error *ngIf=\"password.hasError('required')\">Contraseña requerida</mat-error>\r\n\r\n                </mat-form-field>\r\n\r\n                <mat-form-field hideRequiredMarker ngClass.lt-lg=\"input-sm\">\r\n                    <input type=\"password\" matInput placeholder=\"Repetir contraseña\"\r\n                        [type]=\"hide2 ? 'password' : 'text'\" class=\"input-login\" style=\"color: black !important\"\r\n                        formControlName=\"password2\" (input)=\"onPasswordInput()\" required>\r\n                    <button mat-icon-button matSuffix (click)=\"hide2 = !hide2\" [attr.aria-label]=\"'Hide password'\"\r\n                        [attr.aria-pressed]=\"hide2\">\r\n                        <mat-icon>{{hide2 ? 'visibility_off' : 'visibility'}}</mat-icon>\r\n                    </button>\r\n                    <mat-error *ngIf=\"password.hasError('required')\">Contraseña es requerida</mat-error>\r\n                    <mat-error *ngIf=\"password2.hasError('required')\">Por favor, confirmar la contraseña</mat-error>\r\n                    <mat-error *ngIf=\"password2.invalid && !password2.hasError('required')\">Las contraseñas no coinciden\r\n                    </mat-error>\r\n                </mat-form-field>\r\n\r\n                <div class=\"text-center mt_30\" ngClass.lt-lg=\"input-sm\">\r\n                    <div #recaptcha style=\"display: inline-block;\"></div>\r\n                    <button id=\"submit\" style=\"width: 100%; margin-top: 15px;\" (click)=\"registerUser()\" type=\"submit\" [disabled]=\"!habilitado\"\r\n                        mat-raised-button color=\"primary\">Registrarse</button>\r\n                    <!--[disabled]=\"formGroup.invalid\"-->\r\n                    <p class=\"tycFoot\">\r\n                        <br>\r\n                        Al registrarse, declara que es mayor de edad <br> y acepta los <a class=\"active\"\r\n                            href=\"/terminos-condiciones\" title=\"Leer términos y condiciones\">Términos y condiciones</a>\r\n                        de\r\n                        OneUse.\r\n                    </p>\r\n\r\n                </div>\r\n                <br>\r\n                <div fxLayout=\"row\" fxLayoutAlign=\"center center\" fxLayoutGap=\"15px\" style=\"margin-bottom: 15px;\">\r\n                    <div class=\"text-center\" ngClass.lt-lg=\"input-sm\">\r\n                        <a (click)=\"login()\" tabindex=\"5\" class=\"active\"> ¿Ya tienes una cuenta? Inicia sesión\r\n                        </a>\r\n                    </div>\r\n                    <div class=\"text-center\" ngClass.lt-lg=\"input-sm\">\r\n                        <a href=\"#\" (click)=\"lostPassword()\" tabindex=\"5\" class=\"forgot-password active\">¿Olvidaste tu\r\n                            contraseña?</a>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </form>\r\n</section>"

